import { useState } from "react";

interface Props {
  onClick?: () => void;
  onClick2?: () => void;
}

const Vulnerability = ({ onClick, onClick2 }: Props) => {
  const [showList, setShowList] = useState(false);
  const [showList2, setShowList2] = useState(false);

  function handleButtonClick() {
    setShowList(!showList);
    if (onClick) {
      onClick();
    }
  }

  function handleButtonClick2() {
    setShowList2(!showList2);
    if (onClick2) {
      onClick2();
    }
  }

  return (
    <>
      <button className="btn btn-info" onClick={handleButtonClick}>
        Vulnerabilit√†
      </button>
      {showList && (
        <ul>
          <li>Minimizzazione</li>
          <li>Occultamento</li>
          <li>Aggregazione</li>
          <li>Separazione</li>
          <li>Dimostrazione</li>
          <li>Indormazione</li>
          <li>Rafforzamento</li>
          <li>Controllo</li>
        </ul>
      )}
    </>
  );
};

export default Vulnerability;
